// src/components/Header.js
import React from 'react';
import { Link } from 'react-router-dom';
import { LoginButton } from './Login'; // Asegúrate de que esté importado
import { LogoutButton } from './Logout'; // Asegúrate de que esté importado
import { Profile } from './Profile'; // Asegúrate de que esté importado

const Header = () => {
  return (
    <header className="header">
      <nav>
        <ul className="nav-list">
          <li className="nav-item"><Link to="/" className="nav-link">Home</Link></li>
          <li className="nav-item"><Link to="/service" className="nav-link">Service</Link></li>
          <li className="nav-item"><Link to="/recipes" className="nav-link">Recipes</Link></li>
          <li className="nav-item"><Link to="/restaurants" className="nav-link">Restaurants</Link></li>
        </ul>
      </nav>

      {/* Mostrar el botón de Login/Logout y el perfil */}
      <div className="auth-buttons">
        <Profile />
        <LoginButton />
        <LogoutButton />
      </div>
    </header>
  );
};

export default Header;
